// SUm Link :- https://leetcode.com/problems/two-sum-ii-input-array-is-sorted/description/

// In a sorted array take two pointers oone at start and one at end andd perform operation based on it 

// [2,7,11,15], target = 9
// 1-indexed array of integers numbers that is already sorted


var twoSum = function(numbers, target) {
  let pointer_left = 0; // as its 1-indexed array
  let pointer_right = numbers.length-1; // as its 1-indexed array so last index will be equivalent to length no -1; 
	let output = [];
	while(pointer_left < pointer_right){
		// console.log("numbers",numbers,"pointer_left",pointer_left,"pointer_right",pointer_right,"numbers[pointer_left]",numbers[pointer_left],"numbers[pointer_right]",numbers[pointer_right]);
		// console.log(pointer_left,pointer_right);
		let sum = numbers[pointer_left] + numbers[pointer_right];
		// console.log("sum",sum);
		if(sum == target){
			output=[pointer_left+1,pointer_right+1];
			break;
		}
		if(sum < target){
			pointer_left++;
		} else{
			pointer_right--;
		}
	}
	console.info(`output after loop:- ${output}`);
	return output;
};

